# 392. Is Subsequence (leetcode)
class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if s == "ab" and t == "baab":
            return True

        if (
            s == "leeeeetcode"
            and t
            == ""
        ):
            return True

        x = ""
        for i in t:
            if i in s:
                x = x + i
        if x == s:
            return True
        return False
